package main

import (
	"encoding/base64"
	"encoding/json"
	"io"
	"strings"
	"testing"
)

func TestMarshal(t *testing.T) {
	issue := JIRAIssue{
		ID: "1234",
		Fields: jiraIssueFields{
			JiraFields: JiraFields{
				MantisID19001: "ISSUE-19001",
			},
		},
	}
	b, err := json.Marshal(issue)
	if err != nil {
		t.Fatal(err)
	}
	t.Log(string(b))
}

func TestUnmarshal(t *testing.T) {
	for _, tC := range []struct {
		Src      string
		MantisID string
	}{

		{Src: `{"fields":{
			"customfield_19001":"12345",
			"customfield_18913":"12344",
			"customfield_num":1, 
			"customfield_string":"s", 
			"customfield_arr":["1",2]
		}}`, MantisID: "12345"},

		{Src: strings.Replace(
			b64decode(``),
			"customfield_15902", "customfield_19001", 1),
			MantisID: "15279",
		},
	} {
		var issue JIRAIssue
		if err := json.NewDecoder(strings.NewReader(tC.Src)).Decode(&issue); err != nil {
			t.Fatal(err)
		}
		b, err := issue.Fields.MarshalJSON()
		t.Log(string(b))
		if err != nil {
			t.Fatal(err)
		}
		t.Log(issue)
		if issue.Fields.MantisID() != tC.MantisID {
			t.Errorf("mantisID: got %q, wanted %q", issue.Fields.MantisID(), tC.MantisID)

		}
	}

}

func b64decode(s string) string {
	var buf strings.Builder
	if _, err := io.Copy(&buf, base64.NewDecoder(base64.StdEncoding, strings.NewReader(s))); err != nil {
		panic(err)
	}
	return buf.String()
}
